import React, { Component } from 'react';
import './App.css';
import NavBar from './NavBar';

class App extends Component {
  render() {
    return (
      <div className="App">
      <NavBar />
        <div className="App-body">
          <h1>So you want to play a game?</h1>
        </div>
      </div>
    );
  }
}

export default App;
